import React, { Fragment } from "react";
import Tour from './Tour'
import { Container, Row, Col } from "react-bootstrap";

const Tours = ({ tours }) => {
    return (
        <Fragment>
            <div>OUR TOURS</div>
            <Container>
                {tours.map((tour) => {
                    return 
                        <Col><Tour key={tour.id} {...tour}></Tour></Col>
                })}
            </Container>
        </Fragment>

    );
};

export default Tours;
